def numberOfSubstrings01(s: str) -> int:
	count = 0
	n = len(s)
	for i in range(n):
		hashMap = dict()
		for j in range(i,n):
			hashMap[s[j]] = 1
			if len(hashMap) == 3:
				value = (n-j)
				count += value
				break
	return count



